    false,nt"url": null,nt"notes": "The following notes summarize the results
    of a meeting held between Wetland Management District (WMD) managers/staff and Regional
    Office staff. The purpose of the meeting was to formulate a strategy for completing
    Comprehensive Conservation Plans (CCPs) for the WMDs in Region 6. This meeting provided
    an opportunity to discuss the advantages and disadvantages of possibly grouping
    WMDs for the purpose of preparing a CCP. Our intention is to streamline and make
    the CCP process more efficient and relevant to WMDs. Lastly, the meeting afforded
    everyone an opportunity to learn more about the value of CCPs as well as its process,
    discuss common issues, learn more about our capabilities for collecting and analyzing
    information, and talk about possible implementation strategies.",nt"owner_org":
